INSERT INTO `tblstatic` VALUES (2,'FAQ','<h2 style=\"box-sizing: inherit; font-size: 30px; font-family: &quot;Segoe UI&quot;, Arial, sans-serif; margin-top: 10px; margin-bottom: 10px; color: rgb(0, 0, 0);\"><div style=\"text-align: left; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: 1.6;\"><font face=\"Courier New\"><span style=\"font-size: 18px; text-align: justify;\">The purchaser can purchase tickets via the the mobile app eboxticket on both and Apple and Android versions.&nbsp; &nbsp;<br>The the mobile number inserted on the home screen has to be an Mpesa enabled number. all payments will be deducted from the mpesa balance once the purchaser enters the pin number on prompt. The purchaser can buy multiple tickets and share them via the app, as long as the recipient has also installed and registered on the eboxticket app<br>&nbsp;&nbsp;&nbsp;&nbsp; <br></span></font></div><br></h2>','2018-09-19 06:48:25','Y'),(6,'About ','<div style=\"text-align: left; line-height: 1.6;\"><font face=\"Courier New\"><span style=\"font-size: 18px;\">Our people are your people</span><br><span style=\"font-size: 18px;\">Our team offers an effective combination of broad customer service expertise and deep product knowledge to help you deliver a differentiated customer experience. From a strategic implementation to always-on service, we make sure you get the best value out of eboxticketicket</span><span style=\"font-size: 18px; text-align: justify;\"><span style=\"font-size: 18px;\">. Powered by Systematica ltd</span><br></span></font></div>','2018-09-25 08:15:53','Y'),(7,'Contact','<p class=\"company\" style=\"text-align: justify; margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-size: 28px; font-weight: bold;\"><span style=\"color: rgb(0, 0, 0);\"><font face=\"Helvetica\">sales@systematica-africa.com</font><br></span></p><br>','2018-11-01 13:25:06','Y'),(8,'Terms And Conditions','<p>Tickets are issued subject to the eboxticket terms and conditions however each individual Event or Venue may include their own Terms and Conditions (if applicable), including age restrictions, refund and exchange policy, etc. If an Event or Venue has its own Terms and Conditions, they must be included within the booking process and / or be made available at the venue&nbsp; to be applicable.</p>','2019-06-28 14:10:02','Y');
